Write a script to automate a tedious task, like renaming a batch of files. Sell the script on a site like ScriptBucket. This will take some programming knowledge, but can result in some passive income down the road. Here's how to do it:

import os
import shutil

def copy_logs(logs_dir):
    for root, dirs, files in os.walk(logs_dir):
        for file in files:
            if file.endswith('.log'):
                shutil.copyfile(os.path.join(root, file),
                                os.path.join('/tmp', file))
                os.chmod(os.path.join('/tmp', file), 0o600)

copy_logs('/var/log/nginx/')
